import React, { useState } from 'react';
import axios from 'axios';

function Register({ setPage }) {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    email: '',
    contactNo: '',
    permanentAddress: '',
    temporaryAddress: '',
    gender: '',
    qualification: '',
    company: '',
    role: '',
    username: '',
    password: '',
    confirmPassword: ''
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleRegister = async () => {
    // Basic validations
    if (!formData.firstName || !formData.lastName) {
      alert("First and Last name are required");
      return;
    }
    if (!formData.email.includes('@')) {
      alert("Valid email is required");
      return;
    }
    if (formData.password.length < 6) {
      alert("Password must be at least 6 characters");
      return;
    }
    if (formData.password !== formData.confirmPassword) {
      alert("Passwords do not match");
      return;
    }

    try {
      const res = await axios.post('http://127.0.0.1:8000/register', formData);
      alert(res.data.message);
      setPage('login');
    } catch (err) {
      alert(err.response?.data?.detail || "Registration failed");
    }
  };

  return (
    <div className="container mt-5">
      <div className="card shadow-lg p-4">
        <h2 className="text-center mb-4">Register</h2>

        <input className="form-control my-2" name="firstName" placeholder="First Name" onChange={handleChange} />
        <input className="form-control my-2" name="lastName" placeholder="Last Name" onChange={handleChange} />
        <input className="form-control my-2" name="email" placeholder="Email" type="email" onChange={handleChange} />
        <input className="form-control my-2" name="contactNo" placeholder="Contact No" onChange={handleChange} />
        <input className="form-control my-2" name="permanentAddress" placeholder="Permanent Address" onChange={handleChange} />
        <input className="form-control my-2" name="temporaryAddress" placeholder="Temporary Address" onChange={handleChange} />
        <select className="form-control my-2" name="gender" onChange={handleChange}>
          <option value="">Select Gender</option>
          <option value="Male">Male</option>
          <option value="Female">Female</option>
          <option value="Other">Other</option>
        </select>
        <input className="form-control my-2" name="qualification" placeholder="Highest Qualification" onChange={handleChange} />
        <input className="form-control my-2" name="company" placeholder="Company" onChange={handleChange} />
        <input className="form-control my-2" name="role" placeholder="Role" onChange={handleChange} />
        <input className="form-control my-2" name="username" placeholder="Username" onChange={handleChange} />
        <input className="form-control my-2" name="password" type="password" placeholder="Set Password" onChange={handleChange} />
        <input className="form-control my-2" name="confirmPassword" type="password" placeholder="Confirm Password" onChange={handleChange} />

        <button className="btn btn-success w-100 mt-3" onClick={handleRegister}>Register</button>
        <button className="btn btn-link w-100 mt-2" onClick={() => setPage('login')}>Back to Login</button>
      </div>
    </div>
  );
}

export default Register;
